import React from 'react';

const Projects = () => {
  const projects = [
    { title: 'Project 1', description: 'Description of Project 1' },
    { title: 'Project 2', description: 'Description of Project 2' },
  ];

  return (
    <section id="projects" className="bg-gray-100 dark:bg-gray-800 py-16">
      <h2 className="text-3xl font-bold text-center text-gray-900 dark:text-white">Projects</h2>
      <div className="mt-8 grid grid-cols-1 md:grid-cols-2 gap-8 max-w-4xl mx-auto">
        {projects.map((project, index) => (
          <div key={index} className="p-4 border border-gray-300 dark:border-gray-700 rounded-lg shadow dark:bg-gray-900">
            <h3 className="text-xl font-semibold text-gray-900 dark:text-white">{project.title}</h3>
            <p className="text-gray-600 dark:text-gray-400 mt-2">{project.description}</p>
          </div>
        ))}
      </div>
    </section>
  );
};

export default Projects;
